        var counter = 0;
        var temp_id = 'new0';
        for (var el in this.list_of_questions[target]['answer_prompt']) {
            if (el.includes('new')) {
                temp_id = el;
            }
        }
        temp_id = temp_id.slice(0, 3) + (Number(temp_id.slice(3, 4)) + 1);
        this.list_of_questions[target]['answer_prompt'][temp_id] = value;
